//===----------------------------------------------------------------------===//
$f64
lookup_fpr(const Config& c, u64 m, u64 n) {
  static constexpr u64 bpe_min = 1;
  static constexpr u64 bpe_max = 64;
  static constexpr u64 bpe_x100_step_size = 10;

  // The addressing mode is ignored.
  Config config = c;
  config.addr_mode = dtl::block_addressing::POWER_OF_TWO;

  f64 b = (m * 1.0) / n;
  f64 bpe = std::min(
      std::max(b, bpe_min * 1.0),
      bpe_max * 1.0
      );
  u64 fpr_idx = static_cast<u64>(
      std::round((bpe - bpe_min) * (100/bpe_x100_step_size)));
  auto enc = model::config_to_int(config);
  auto search = std::lower_bound(configs, configs + config_cnt, enc);
  auto lut_idx = static_cast<u64>(std::distance(configs, search));
  if (lut_idx >= config_cnt) lut_idx = config_cnt - 1;
  if (configs[lut_idx] != enc) {
    std::stringstream err;
    err << "Unknown filter configuration: " << c;
    throw std::invalid_argument(err.str());
  }
  return fpr_lut[lut_idx][fpr_idx];
}
