//===----------------------------------------------------------------------===//
$u32
lookup_optimal_k(const Config& c, f64 bits_per_element) {
  static constexpr u64 bpe_min = 1;
  static constexpr u64 bpe_max = 64;
  static constexpr u64 bpe_x100_step_size = 10;

  Config config = c;
  // The addressing mode is ignored.
  config.addr_mode = dtl::block_addressing::POWER_OF_TWO;
  // The given k is ignored.
  config.k = 1;

  f64 bpe = std::min(
      std::max(bits_per_element, bpe_min * 1.0),
      bpe_max * 1.0
      );
  u64 opt_k_idx = static_cast<u64>(
      std::round((bpe - bpe_min) * (100/bpe_x100_step_size)));
  auto enc = model::config_to_int(config);
  auto search = std::lower_bound(
    optimal_k_configs, optimal_k_configs + optimal_k_config_cnt, enc);
  auto lut_idx = static_cast<u64>(std::distance(optimal_k_configs, search));
  if (lut_idx >= optimal_k_config_cnt) lut_idx = optimal_k_config_cnt - 1;
  if (optimal_k_configs[lut_idx] != enc) {
    std::stringstream err;
    err << "Unknown filter configuration: " << c;
    throw std::invalid_argument(err.str());
  }
  return optimal_k_lut[lut_idx][opt_k_idx];
}
